"""**Step 1 : Import necessary libraries**

"""

import lightkurve as lk
import matplotlib.pyplot as plt
import numpy as np

"""**Step 2 : Ask the user for TIC ID input:**"""

tic_id = input("Enter the ID of the star: ")

"""**Step 3 : Retrieve all available TESS data for the given TIC ID:**"""

try:
    target = lk.search_targetpixelfile(tic_id, mission="TESS").download_all()
except Exception as e:
    print("Error: Could not retrieve data for the given TIC ID.")
    print(e)
    exit()

"""***STEP 4: Plot the target pixel file ***

"""

target.plot()

"""**Step 5 : Combining the individual frames into a lightcurve as an aperture mask**
(For improved image analysis)
"""

sector_data = lk.search_lightcurve(tic_id, author = 'SPOC')
sector_data

light_curve = sector_data.download_all()
light_curve

light_curve.plot(color='blue')

