"""Step 6: Flattening the light curve to enhance pattern visibility"""

lc = light_curve.flatten().remove_outliers()
lc.plot(color ='blue')
plt.title(f"Flattened Light Curve - Sector 1")

"""![Picture1.png](data:image/png;base64,)

Step 7 : After preprocessing;
Phase-fold the light curve to confirm period and transit time

box_least_squares = Box Least Squares
"""

period = np.linspace(1, 14, 10000)
# Create a BLSPeriodogram
box_least_squares = lc.to_periodogram(method='bls', period=period, frequency_factor=500);
box_least_squares.plot(color= 'blue');

planet1_period = box_least_squares.period_at_max_power
planet1_transit_time = box_least_squares.transit_time_at_max_power
planet1_dur = box_least_squares.duration_at_max_power

print('Exoplanet period:',planet1_period);

phase_folded_lc = light_curve.fold(period=planet1_period, epoch_time=planet1_transit_time).scatter(color = 'red')
phase_folded_lc.set_xlim(-2, 2);

planet1_mask = box_least_squares.get_transit_mask(period=planet1_period,
                                     transit_time=planet1_transit_time,
                                     duration=planet1_dur)

masked_lc = lc[~planet1_mask]
masked_plot = masked_lc.scatter();
lc[planet1_mask].scatter(ax=masked_plot, color='red', label='Planet 1 Masked Plot');

print("Exoplanet transit_time:",planet1_transit_time,"days")

planet1_model = box_least_squares.get_transit_model(period=planet1_period,
                                       transit_time=planet1_transit_time,
                                       duration=planet1_dur)

ax = lc.fold(planet1_period, planet1_transit_time).scatter()
planet1_model.fold(planet1_period, planet1_transit_time).plot(ax=ax, c='r', lw=2)
ax.set_xlim(-5, 5);

